import logo from './logo.svg';
import './App.css';
// import { Document } from 'react-pdf'
import Header from './components/Header'
import Footer from './components/Footer'
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <div>
      <Header />

        <section>
          <img id="seattle" src={seattle} />
          <div className="container">
            <div className="centered">WEB DEVELOPMENT &amp;<br /> PROJECT MANAGEMENT</div>
          </div>
        </section>
        <main className="col s12 m8 l9" id="mv">
          <div className="about col s3"><h4>About Me</h4></div>
          <div className="text col s9">
            <p>
              Hi, I'm Minhvan. I am a former project manager turned web developer. I'm currently studying coding at the University of Washington. I'm fascinated by the world of technology and what it can do. I think the possibilities are endless. So I'm turning that fascination in reality and pursuing a career in coding.

              Some of my other interests include running, volleyball, and games.  Let's connect!
            </p>
          </div>
        </main>

        <Footer />
      </div>

    </div>
  );
}

export default App;
